The series revolves around the Ewings, a wealthy Dallas family in the oil and cattle-ranching industries. It focuses mainly on Christopher Ewing (Jesse Metcalfe), the adopted son of Bobby (Patrick Duffy) and Pamela (Barnes) Ewing, and John Ross Ewing III (Josh Henderson), the son of J. R. (Larry Hagman) and Sue Ellen Ewing (Linda Gray). Both John Ross and Christopher were born during the original series' run and were featured in it as children (although played by different actors). Now grown up, John Ross has become almost a carbon copy of his father, bent on oil, money, and greed. Christopher, meanwhile, has become a lot like Bobby, in that he is more interested in the upkeep of Southfork Ranch, much like his adoptive father. As an additional point of contention, Christopher is also becoming a player in alternative energy (methane clathrate recovery), thereby eschewing the oil business. However John Ross is determined to resurrect the Ewings' former position in the oil industry.


